import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import MainContents from './components/MainContents';

function App() {
  return (
    <Router>
        <div className="App">
          <Routes>
            <Route path='/home'>
            <Header/>
            <MainContents/>
            </Route>
          </Routes>
        </div>
    </Router>
  );
}

export default App;
